MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "CalibrenmModelflow is the next generation model calibration platform. It is accessed from the Calibre WORKbench model development environment. ");
MGCAddSnippet(5, "Process models are used to simulate the results of lithography designs on a wafer. As design sizes shrink, more complex models are needed to accurately predict and simulate the effects of those elements.");
MGCAddSnippet(6, "Calibre nmModelflow uses some key concepts related to the modeling flow experience.");
MGCAddSnippet(7, "Calibre nmModelflow has specific requirements to run.");
MGCAddSnippet(8, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(9, "The Calibre nmModelflow GUI contains multiple tabs and sub-windows to display and interact with data. ");
MGCAddSnippet(10, "The Calibre nmModelflow Command Line Interface (CLI) dictionary is available as an online help file for better search capability within the software.");
MGCAddSnippet(11, "Calibre nmModelflow contains powerful database functionality to assist in managing multiple items in your work environment. Understanding the most effective ways to use the database can improve your calibration efforts.");
MGCAddSnippet(12, "Calibre nmModelflow has a number of different entry points, depending on whether you are migrating from a modelflow_v2 environment or continuing previous Calibre nmModelflow work. ");
MGCAddSnippet(13, "Gauges contain measurement data used during calibration and simulation. Most stages operate on gauge data, or subsets of gauge data.");
MGCAddSnippet(14, "A gauge file typically has a Lithomodel file and a design file associated with it, so that process information is kept together in the database.");
MGCAddSnippet(15, "Gauge files, which contain measurements of critical dimensions from a test chip, are used to calibrate the mathematical model of the process. Standard modelflow_v2 gauge files are automatically converted to Calibre nmModelflow format. ");
MGCAddSnippet(16, "When you import or activate gauges, you may encounter the warning message  gauge has a length of x nm which is less than measured resist CD y nm.  Resolve this problem by lengthening the gauges in the gauge file.");
MGCAddSnippet(17, "You may need to adjust gauge locations when gauges are not correctly placed in the position where the CDs are actually measured on the wafer. Gauges that are poorly placed near line ends (A), corners (B), and 45 degree edges of contours (C) may give unexpected EPE results.");
MGCAddSnippet(18, "Calibre nmModelflow has the capability to recenter gauges that may not be aligned well with the geometry of the associated target layer. ");
MGCAddSnippet(19, "Filtering gauges helps narrow your focus to only inspect gauges that are critical to your design or that may cause problems.");
MGCAddSnippet(20, "Gauge data can be sorted and filtered from the Gauge Analysis tab. They can also be highlighted and viewed in the layout using the functions in the Cross Probe and Filter tab.");
MGCAddSnippet(21, "You can add more columns to the Gauge Analysis tab in order to expand on the data results or create custom output values. Calibre nmModelflow maintains a universal gauge spreadsheet that contains all defined columns. Only a selected subset of the universal gauge spreadsheet is displayed in the Gauge Analysis tab.");
MGCAddSnippet(22, "Focus-sensitive data is of particular interest in model calibration. The Calibre nmModelflow GUI has the capability to filter out test structures that meet certain criteria. ");
MGCAddSnippet(23, "Depth of focus information can be generated for a process window in Calibre nmModelflow when there are enough process conditions available in the super gauge data object.");
MGCAddSnippet(24, "Calibre nmModelflow can calculate the Process Capability Index (Cpk) for groups in a gauge file given upper and lower limits. Currently, this functionality is only available via a Calibre nmModelflow Tcl command.");
MGCAddSnippet(25, "Because some model parameters may be more sensitive to small changes than others, Calibre nmModelflow has the ability to test individual parameters for a given gauge data file and litho model.");
MGCAddSnippet(26, "VEB etch models can occasionally be generated with terms and kernel densities that cancel each other out. Calibre nmModelflow allows you to run a test on a loaded etch model for quality purposes before you use it in calibration.");
MGCAddSnippet(27, "You can add a column to the Gauge Analysis tab in order to display calculated MEEF (Mask Error Enhancement Factor) values. Calibre nmModelflow maintains a universal gauge spreadsheet that contains all defined columns. Only a selected subset of the universal gauge spreadsheet is displayed in the Gauge Analysis tab.");
MGCAddSnippet(28, "In some cases, measuring the Image Log Slope (ILS) and related information at a target edge is more useful than the image intensity at the simulation contour edge.");
MGCAddSnippet(29, "Calibre nmModelflow can generate simulation data to detect possible places where extra printing may occur in your design file. The standard comparison is between CTR and resist model simulations.");
MGCAddSnippet(30, "The Extra Printing feature in the Calibre nmModelflow GUI performs the most common functionality needed to check for extra printing between CTR and resist model simulations. Advanced options are only available via the console.");
MGCAddSnippet(31, "For some designs, a group of gauges are used to measure a drawn shape, instead of a single gauge CD.");
MGCAddSnippet(32, "When working with design files that include SRAFs, it can be helpful to know when SRAFs are being crossed by user gauges.");
MGCAddSnippet(33, "In some cases, calibration of test patterns with SRAFs may give false positive printing results, because standard test patterns do not include measurement entries for SRAFs. Calibre nmModelflow can detect and insert gauges for SRAFs into the gauge file.");
MGCAddSnippet(34, "Contours can be used as an alternate calibration method for models. Simulation tests can be compared against the contours either independently or in conjunction with gauges.");
MGCAddSnippet(35, "Filtering contour blocks and sites helps narrow the focus to sites of importance.");
MGCAddSnippet(36, "Litho models store information about the process. This includes all relevant model components, mask exposure polarity, the exposure conditions used, and references to one or more exposure layers to be mapped to layout geometry");
MGCAddSnippet(37, "Litho models are a collection of models. You can specify one litho model instead of multiple models in commands. Litho models are a key component in Calibre nmModelflow.");
MGCAddSnippet(38, "You can easily import litho models that are not in your database, even if they were created in a version of Calibre WORKbench previous to the release of Calibre nmModelflow. ");
MGCAddSnippet(39, "Default litho models may sometimes only include the nominal optical model. In order to measure gauge information for a super gauge data object, you must generate all the process conditions. ");
MGCAddSnippet(40, "Use the Process Window Data View to compare values across multiple process window conditions.");
MGCAddSnippet(41, "Calibre nmModelflow operations require one or more items loaded into the database. ");
MGCAddSnippet(42, "Importing an existing database from another user or another session is a simple way to populate a database. Databases can also be exported and imported to migrate data from another database to a current one.");
MGCAddSnippet(43, "Databases are stored individually on a per-user basis. To share a database, you must export it to a file that can be imported by another Calibre nmModelflow user.");
MGCAddSnippet(44, "Filters reduce the gauge data set by removing any gauges that do not meet the criteria of the filter. A typical filter might remove all the vertical features from the gauge data set in order to calibrate a model that works for horizontal features only; another filter might operate on test structures of only one type. ");
MGCAddSnippet(45, "The Calibre nmModelflow GUI creates a default set of calibration plots, which are run on the active data set. However, you can create custom plots that are saved in the database.");
MGCAddSnippet(46, "Use metrics to measure figures of merit in gauge data. Metrics are applied to the results of simulations and calibrations. They are used to establish alternative methods to evaluate the quality of a model. Metrics can also be created in the GUI for use with the active data. ");
MGCAddSnippet(47, "After you have litho models, gauges, and layouts in your database, you create stages to operate on them. Multiple types of stages are available in Calibre nmModelflow.");
MGCAddSnippet(48, "Stages represent simulation and calibration commands in a job. When you create a stage with the Flow Stage Wizard, you define simulation commands and set parameters and optimizer settings for an optimization run. Calibration jobs can be run independently, or can be linked with the results of another calibration job. ");
MGCAddSnippet(49, "As an alternative to creating stages individually, use the Experiment Stage Wizard to create multiple stages using variations of parameters and models together in a full factorial search.");
MGCAddSnippet(50, "The Fast Rigorous Model (FRM) is designed for use with CM1 resist models. It interacts with other resist model settings during the creation of a calibration stage, and may result in a different version of the active model.");
MGCAddSnippet(51, "The Fast Rigorous Model (FRM) is a compact resist model used for full chip simulations. It can be used in place of or in conjunction with the CM1 resist model. It is not intended for 3D resist simulations.");
MGCAddSnippet(52, "The genetic algorithm (GA) mimics the process of natural selection in order to obtain an optimal model. This is accomplished by using previously found optimizations as well as investigating new configurations. Model calibration with the genetic algorithm is scalable on a large number of CPUs, can specify multiple starting points, and track and report on multiple model candidates.");
MGCAddSnippet(53, "Etch bias rule tables are used when you have a VEB etch bias retargeting process. You use etch bias rule tables with Calibre nmBIAS to quickly adjust edges for resist target polygons. ");
MGCAddSnippet(54, "The Etch Bias Table can optionally output additional merge tables that combine multiple tables in the same generation run.");
MGCAddSnippet(55, "Calibration jobs are created and stored in the database, and then explicitly executed later. This allows you to set up multiple experiments before running any jobs. There are several methods you can use to run a calibration job after it is set up in Calibre nmModelflow.");
MGCAddSnippet(56, "Calibration jobs are the core of optimization for Calibre nmModelflow. You must set up a calibration job in order to generate output.");
MGCAddSnippet(57, "This procedure describes how to run a job from the Calibre nmModelflow GUI.");
MGCAddSnippet(58, "Direct mode runs Calibre nmModelflow without the GUI (batch mode). It is useful for debugging runscripts. ");
MGCAddSnippet(59, "Standalone mode is useful where a job directory is not on the same filesystem where the job will be executed.");
MGCAddSnippet(60, "The job status represents the state of a Calibre nmModelflow calibration job in the database. Because jobs are run independently of the GUI, a job s status is stored in a file in the Calibre nmModelflow database. The status is viewable either in the GUI or as a text file.");
MGCAddSnippet(61, "You can output HTML reports for completed calibration jobs. The Calibre nmModelflow GUI makes it easy to create reports with a punchlist of items to report; no coding is required.");
MGCAddSnippet(62, "To verify a model you compare multiple calibrated models with a specific data set. You determine the metrics that matter.");
MGCAddSnippet(63, "Use generic jobs to run a stage without having an associated gauge set and litho model as part of the job description. The primary purpose of a generic job is to save a set of commands that can be re-run as a job from the Calibration Job tab.");
MGCAddSnippet(64, "Once you have completed a successful calibration run, the calibrated models need to be exported in order to be used by other Calibre tools. ");
MGCAddSnippet(65, "The model returned from the successful calibration, known as the Final Model, is the only model that is saved to the disk. However, the other models that were tested during calibration can be rebuilt as a separate calibration job.");
MGCAddSnippet(66, "After completing a calibration run, you may have a number of features with large simulation errors. Creating Pattern Specific Kernels (PSK) allows you to fix the high simulation error gauges in a targeted fashion.");
MGCAddSnippet(67, "For situations where multiple calibration jobs need their components changed, use the Multiple Edit utility in Calibre nmModelflow to quickly adjust selected jobs.");
MGCAddSnippet(68, "For CM1 resist models, some modeling terms are more sensitive to the interaction radius (IR) than others. Calibre nmModelflow can analyze a set of calibration results and list terms that are highly sensitive.");
MGCAddSnippet(69, "Calibre nmModelflow stages that include a CM1 resist model can have additional analysis information added to the job results. This information can be used to simplify the model (by reducing the number of terms in the model) such that it simulates faster with a very similar result.");
MGCAddSnippet(70, "After performing CM1 model analysis, you may be able to remove less critical terms from the model. Calibre nmModelflow provides a tool that sets up calibration jobs to test the removal of one or more terms.");
MGCAddSnippet(71, "Use the Akaike Information Criterion (AIC) as a way to measure the quality of model results relative to other model results.");
MGCAddSnippet(72, "Performing AIC calibration requires splitting a selected gauge set into two randomized sets, one for calibration and one for verification.");
MGCAddSnippet(73, "Use the Calibre nmModelflow Calibration Job Manager tab to generate comparative reports from an Akaike Information Criterion (AIC) run. AIC is most useful for resist and topographical modeling calibration.");
MGCAddSnippet(74, "Calibre nmModelflow supports calibrating a CTR model for the SRAF print avoidance (SPA) model. Gauge output for SPA calibration is different from other gauge output.");
MGCAddSnippet(75, "Training a machine learning model pairs a neural network assisted model with an existing resist or etch model. In order to do this, you must train a neural network model with gauge data.");
MGCAddSnippet(76, "Calibre nmModelflow is strongly GUI-driven. Multiple wizards and dialog boxes guide you through tasks, and generate commands in the CLI parser that are executed using the GUI choices to correctly set the parameters.");
MGCAddSnippet(77, "The Calibration Job Manager is located in the primary display area. It lists and manages all jobs defined in the database. Jobs are created from stages, and incorporate litho models, gauge objects, filters, metrics, and plots.");
MGCAddSnippet(78, "The Calibration Job Record dialog box shows the results of a calibration run.");
MGCAddSnippet(79, "Use the Database Browser in Calibre nmModelflow to work with components of your working environment.");
MGCAddSnippet(80, "A litho model contains process information, and also contains other models with their own separate definition files. Use the Edit Lithomodel dialog box to navigate through the parts of a litho model and make changes as needed.");
MGCAddSnippet(81, "Use the Resist Model Composition Tool to create a customized resist model for a litho model based on an existing resist model form.");
MGCAddSnippet(82, "Wizards in this group create stages that optimize specific types of models.");
MGCAddSnippet(83, "This wizard appears when you choose the Calibrate option of the Stage Wizard with the Mask check box selected.");
MGCAddSnippet(84, "This wizard appears when you choose the Calibrate option of the Stage Wizard with the Optics check box selected. It sets the calibration parameters for the optical model.");
MGCAddSnippet(85, "This wizard appears when you choose the Calibrate option of the Stage Wizard with the ZPlanes check box selected. It sets the calibration parameters for the ZPlanes model.");
MGCAddSnippet(86, "This wizard appears when you choose the Calibrate option of the Stage Wizard with the Resist check box selected.");
MGCAddSnippet(87, "This wizard appears when you choose the Calibrate option of the Stage Wizard with the TOPO check box selected. Additionally, Topo signals terms can be set when the default Fasttopo value is set to 2 (the default).");
MGCAddSnippet(88, "This wizard appears when you choose the Calibrate option of the Stage Wizard with the Etch check box selected.");
MGCAddSnippet(89, "This wizard appears when you choose the N2R or N2E checkboxes in the Calibrate section of the Stage Wizard dialog.");
MGCAddSnippet(90, "During litho model creation, you have the option to create a custom VEB etch model instead of using the VEB modelform templates.");
MGCAddSnippet(91, "The Flow Stage Wizard, Optimizer Settings appears as part of the wizard sequence after you select the Calibrate option. It sets the search optimization parameters for calibration. ");
MGCAddSnippet(92, "This wizard appears as part of the wizard sequence when you have selected the Calibrate Etch option for a stage. It sets the optimization search algorithm for the etch model. ");
MGCAddSnippet(93, "Wizards in this group simulate CD values for gauges and an associated litho model.");
MGCAddSnippet(94, "Wizards in this group adjust the beamfocus and defocus start parameters to find the best focus values for one or more process window conditions.");
MGCAddSnippet(95, "This stage optimizes beamfocus by optimizing defocus_start independently and then minimizing the mean focus shift. This option is used for process window configurations where the focus center is determined as the parabolic fit to the through-focus CD at each dose.");
MGCAddSnippet(96, "This stage optimizes beamfocus by optimizing defocus_start independently and then minimizing the mean focus shift. This option is used for a single focus condition.");
MGCAddSnippet(97, "This wizard appears when you choose either the Center Focus By Bossung Adjust on Through-Focus Data option in the Stage Wizard.");
MGCAddSnippet(98, "This wizard appears when you choose the Center Focus By Bossung Adjust on Nominal Data option of the Stage Wizard.");
MGCAddSnippet(99, "Wizard stages in this group optimize and build results using the litho model specified for the stage.");
MGCAddSnippet(100, "An etch bias table is used by the Calibre nmBIAS BIASRULE command to move edge fragments based on their critical dimension measurement during OPC. Calibre nmModelflow uses the Etch Bias Table Generation wizard to create tables based on your input.");
MGCAddSnippet(101, "The Contour Analysis tab displays and allows you to manipulate the active contour object.");
MGCAddSnippet(102, "");
MGCAddSnippet(103, "The Plots tab shows selected data traces for gauge information columns in a visual format. Multiple plots can be displayed.");
MGCAddSnippet(104, "This wizard appears when you select the Gauge Data Plot item in the Plot Wizard.");
MGCAddSnippet(105, "Defines the appearance of the plots created using contour data.");
MGCAddSnippet(106, "This wizard appears when you select the Cutline Plot item in the Plot Wizard.");
MGCAddSnippet(107, "This wizard appears when you select the Thrufocus, Thrudose, or Thruplanes buttons from the Plot button bar or the first screen of the Plot Wizard.");
MGCAddSnippet(108, "This wizard appears when you select the Contour Plot item in the Plot Wizard.");
MGCAddSnippet(109, "The Metrics Viewer tab shows a representation of values of interest from a calibration run. This tab is especially useful for process window configurations, as the data is output on a dose and focus matrix.");
MGCAddSnippet(110, "Metric groups are a combination of metrics and filters that can be run on the active gauge item. Use this wizard to quickly create a metrics group. ");
MGCAddSnippet(111, "By default, Calibre nmModelflow runs in multi-threaded (MT) mode. Creating a remote file allows you to run it in distributed (Calibre MTflex) mode. Calibre MTflex mode causes dispatcher jobs to run remotely. ");
MGCAddSnippet(112, "Remote files contain information about machines and CPUs where remote tasks should be run. At least one remote file is required to run in Calibre MTflex mode, and the dispatcher requires a special runscript file.");
MGCAddSnippet(113, "Calibre nmModelflow has multiple job execution modes that use different methods to run a job.");
MGCAddSnippet(114, "Dispatcher mode requires some specific instructions independent of Calibre MTflex configuration. ");
MGCAddSnippet(115, "Calibre nmModelflow includes a set of best practice filters, plots, and metrics that you can add to your database. ");
MGCAddSnippet(116, "Best practices are not loaded when you create a database.");
MGCAddSnippet(117, "The best practices for Calibre nmModelflow are current for the current release.");
MGCAddSnippet(118, "It is useful to understand the system flow and runscripts used by the Calibre nmModelflow tool.");
MGCAddSnippet(119, "The system flow in Calibre nmModelflow involves the use of specialized runscripts that are executed by calibration jobs.");
MGCAddSnippet(120, "The runscript file can be customized, usually by a system administrator. All runscripts have specific requirements for use, but can be written in any scripting language.");
MGCAddSnippet(121, "Jobs can be executed manually, outside of the dispatcher. However, this methodology is only intended as a debugging tool, and should not be used for normal job execution.");
MGCAddSnippet(122, "The run_lsf.sh runscript executes jobs within the Calibre nmModelflow environment using the Platform LSF distribution system.");
MGCAddSnippet(123, "The run_calcm_static.sh and run_calcm_dynamic.sh runscripts execute jobs within the Calibre nmModelflow environment using the Calibre CalCM server distribution system.");
MGCAddSnippet(124, "The Gauge Analysis tab contains displayed gauge columns from the active gauge object. Because there are more gauge columns than can easily fit in the visible area of the tab, most columns are hidden by default. ");
MGCAddSnippet(125, "Resist 3D (R3D) Calibration refers to modeling one of a number of height-sensitive process models. Calibre nmModelflow supports the following types of R3D configurations:");
MGCAddSnippet(126, "Resist 3D models have some similar concepts and some qualities that are specific to a type of R3D model.");
MGCAddSnippet(127, "Understanding which type of resist 3D modeling you are working with sets the type of information you need to specify in the litho model, gauge data file, and calibration stages. It also sets the kind of output you receive after a successful simulation or calibration run.");
MGCAddSnippet(128, "The Super Gauge Data file contains multiple gauge data sets. It was originally designed for process window calibration, because it could store gauge data sets at different dose and defocus values in a single file, but has been modified starting with version 2 to store Resist 3D data sets.");
MGCAddSnippet(129, "The ZPlanes file is used in both SRAF and toploss prediction. It contains parameters that are specific to the SRAF and toploss flows.");
MGCAddSnippet(130, "For SRAF and toploss models, prediction simulations involve printing versus not-printing characteristics tested on the gauges in the gauge data file. ");
MGCAddSnippet(131, "Some of the resist 3D modeling solutions have been available for a number of years from Siemens EDA, but the methods and requirements are slightly different for Calibre nmModelflow. ");
MGCAddSnippet(132, "SRAF Calibration in the Calibre nmModelflow GUI can be implemented using the Flow Stage Wizard.");
MGCAddSnippet(133, "SRAF calibration in Calibre nmModelflow has the following additional information specific to configuring a litho model. ");
MGCAddSnippet(134, "Configuring a stage for SRAF Calibration uses the Optics, ZPlanes and Resist stages.");
MGCAddSnippet(135, "When an SRAF calibration job successfully completes, use the View button in the Calibre nmModelflow GUI to view the results.");
MGCAddSnippet(136, "Toploss Calibration in the Calibre nmModelflow GUI can be implemented using the Flow Stage Wizard.");
MGCAddSnippet(137, "Toploss calibration in Calibre nmModelflow has the following additional information specific to configuring a litho model.");
MGCAddSnippet(138, "Configuring a stage for toploss calibration uses the Optics, ZPlanes and Resist stages.");
MGCAddSnippet(139, "When a toploss calibration job successfully completes, use the View button in the Calibre nmModelflow GUI to view the results.");
MGCAddSnippet(140, "Resist 3D models are loaded into Calibre nmOPC using a litho model, and are accessed via the pw_condition command.");
MGCAddSnippet(141, "Resist 3D models are loaded into Calibre OPCverify in a litho model, and are accessed via the image command. ");
MGCAddSnippet(142, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

